[[package]]
name = "alembic"
version = "1.7.6"
description = "A database migration tool for SQLAlchemy."
category = "dev"
optional = false
python-versions = ">=3.6"

[package.dependencies]
Mako = "*"
SQLAlchemy = ">=1.3.0"

[package.extras]
tz = ["python-dateutil"]

[[package]]
name = "amazon-textract-prettyprinter"
version = "0.0.10"
description = "Amazon Textract Helper tools for pretty printing"
category = "main"
optional = false
python-versions = ">=3.6"

[package.dependencies]
amazon-textract-response-parser = ">=0.1.5"
boto3 = "*"
botocore = "*"
tabulate = "0.8.9"

[[package]]
name = "amazon-textract-response-parser"
version = "0.1.27"
description = "Easily parse JSON returned by Amazon Textract."
category = "main"
optional = false
python-versions = ">=3.6"

[package.dependencies]
boto3 = "*"
marshmallow = "3.11.1"

[[package]]
name = "appdirs"
version = "1.4.4"
description = "A small Python module for determining appropriate platform-specific dirs, e.g. a \"user data dir\"."
category = "dev"
optional = false
python-versions = "*"

[[package]]
name = "awscrt"
version = "0.12.6"
description = "A common runtime for AWS Python projects"
category = "main"
optional = false
python-versions = ">=3.6"

[[package]]
name = "better-exceptions"
version = "0.3.3"
description = "Pretty and helpful exceptions, automatically"
category = "dev"
optional = false
python-versions = "*"

[package.dependencies]
colorama = {version = "*", markers = "sys_platform == \"win32\""}

[[package]]
name = "boto3"
version = "1.21.13"
description = "The AWS SDK for Python"
category = "main"
optional = false
python-versions = ">= 3.6"

[package.dependencies]
botocore = ">=1.24.13,<1.25.0"
jmespath = ">=0.7.1,<1.0.0"
s3transfer = ">=0.5.0,<0.6.0"

[package.extras]
crt = ["botocore[crt] (>=1.21.0,<2.0a0)"]

[[package]]
name = "boto3-stubs"
version = "1.21.22"
description = "Type annotations for boto3 1.21.22 generated with mypy-boto3-builder 7.3.0"
category = "dev"
optional = false
python-versions = ">=3.6"

[package.dependencies]
botocore-stubs = "*"
mypy-boto3-s3 = {version = ">=1.21.0", optional = true, markers = "extra == \"s3\""}
mypy-boto3-textract = {version = ">=1.21.0", optional = true, markers = "extra == \"textract\""}

